DROP TABLE IF EXISTS `casesheet`;
CREATE TABLE IF NOT EXISTS `casesheet` (
  `caseid` int(11) NOT NULL AUTO_INCREMENT,
  `railway` int(11) NOT NULL,
  `coachNo` varchar(25) NOT NULL,
  `coachType` int(11) NOT NULL,
