  `manufacturer` varchar(25) NOT NULL,
  `description` text,
  `dateFailure` date NOT NULL,
  `complainant` int(11) NOT NULL,
  `icfComments` text,
  `closed` enum('true','false') NOT NULL,
  `fileUploaded` enum('true','false') NOT NULL,
